import { Injectable } from '@angular/core';
import { BASE_ROUTE } from 'src/environments/environment';

@Injectable({
    providedIn: 'root',
  })
  export class ApiService {
    public _REMOTE_END_POINTS = {
        URL_GET_ACCOUNT_PARAMS: `${BASE_ROUTE}auth/login`,
    };
  }

import { Injectable } from '@angular/core';
import { HttpClient, HttpHeaders } from '@angular/common/http';
import { Observable } from 'rxjs';
import { ApiService } from './net/ApiService';
import { AuthRepository } from '../domain/repository/AuthRepository';

@Injectable()
export class AuthRepositoryImpl implements AuthRepository {
  private _headers = {};
  private _contenttype = 'content-type';

  constructor(private apiService: ApiService ,private httpClient: HttpClient) { }

  private setHeaders() {
    this._headers[this._contenttype] = 'application/json';
  }

  login(
    username: string,
    password: string
  ): Observable<any> {
    const body = {
      username,
      password
    };
    this.setHeaders();

    return this.httpClient.post<any>(
      this.apiService._REMOTE_END_POINTS.URL_GET_ACCOUNT_PARAMS,
      body,
      {
        headers: this._headers,
      }
    );
  }

}

import { Injectable } from '@angular/core';
import { LoginPage } from 'src/app/pages/auth/login/login.page';
import { LoginUseCase } from '../../../domain/usecases/AuthUsesCase/LoginUseCase';
import { BasePresenter } from '../../base.presenter';

@Injectable({
    providedIn: 'root',
  })
  export class LoginPresenter implements BasePresenter {
    private view: any;

    constructor(
      public loginUseCase: LoginUseCase
    ) {}


    setView(component: any){
        this.view = component as LoginPage;
    }

    async login(username: string, password: string): Promise<any> {
        try {
            const response = await this.loginUseCase.login(username, password);
            if (response && response.token) {
                return response;
            } else {
                return null;
            }
        } catch (error) {
            console.error('ERROR IN REQUEST LOGIN', error);
            return null;
        }
    }


  }

import { Inject, Injectable } from '@angular/core';
import { AuthRepository, AUTH_REPOSITORY } from '../../repository/AuthRepository';

@Injectable()
export class LoginUseCase {
    constructor(
      @Inject(AUTH_REPOSITORY) private authRepository: AuthRepository
    ) { }

    login(
      username: string,
      password: string
    ): Promise<any> {
        return new Promise((resolve, reject) => {
        this.authRepository
          .login(username, password)
          .subscribe(resolve, reject);
      });
    }

}

